import React from "react";
import '../App.css';
import logo from '../src/icons8-marker-n-50.png';
import {Link} from 'react-router-dom';

const Nav = () => {
    return (
        <nav>
          <img src={logo}></img>
          <ul>
            <Link to='/'>
              <li>Home</li>
            </Link>
            <Link to='/about'>
              <li>About</li>
            </Link>
            <Link to='/contact'>
              <li>Contact</li>
            </Link>
          </ul>
        </nav>
    );
};

export default Nav;
